import React, { Component } from "react";

export default class CreateMovie extends Component {
  constructor(props) {
    super(props);
    this.state = {
      username: "",
      description: "",
      length: 0,
      publishedyear: new Date(),
      rate: 0,
      users: [],
    };
  }

  onChangeDescription(e) {
    this.setState({
      description: e.target.value,
    });
  }

  onChangePublishedyear(date) {
    this.setState({
      publishedyear: date,
    });
  }

  onChangeLength(e) {
    this.setState({
      length: e.target.value,
    });
  }
  onChangeRate(e) {
    this.setState({
      rate: e.target.value,
    });
  }

  render() {
    return <div>HELLP</div>;
  }
}
